import React, { Component } from 'react'
import ConditionalSection from './sections/conditional'

class App extends Component {
  render () {
    const arr = [1, 1, 3, 4];
    return (
      <div className="App">
        <ConditionalSection />
        <h1>Trabajando con listas:</h1>
        {arr.map((numero, index) => {
            return <p key={index}>Soy el numero {numero}</p>
          })
        }
      </div>
    );
  }
}

export default App;
